INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float, attribute_original_id, sort_key_int, sort_key_string, data_type_string) VALUES (523,'eng-GB',4,161,141,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\"\n         xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\">\n  <paragraph>\n    <line>These guidelines also apply to any news groups, mailing lists or other web forums you frequent. If you follow the guidelines you will find that your problems get more attention from people and that your problems might actually get solved. </line>\n    <line>How to Log In</line>\n  </paragraph>\n  <paragraph>You can log in by entering your user name and password here</paragraph>\n  <paragraph>\n    <line>\n      <strong>How to Register a New User</strong>\n    </line>\n    <line>You can register a new user by pressing the &quot;Sign up&quot; button here.</line>\n    <line>As soon as you have filled in the information you have created an account and have the privileges that comes with that.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Choose the correct forum</strong>\n    </line>\n    <line>Use a few minutes to consider which forum you should post to. Posting it to a &quot;General&quot; forum is not as effective as posting to the &quot;Install&quot; forum if you question is about install-related questions. Don&apos;t post in several different forums. If your question belongs in the &quot;Install&quot; forum, posting it in &quot;General&quot; or &quot;Developer&quot; aren&apos;t very helpful. </line>\n    <line>Consider this: If you post to the wrong forum the chances for someone actually answering it is lower than if you post it in the correct forum. Furthermore your off-topic post will just make it harder for those posting correctly to be noticed among those who post in the wrong forums.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Search the forums</strong>\n    </line>\n    <line>Before you ask your question try to search the archives of the forum. You&apos;d be surprised to notice how often your exact problem has been solved. You should also read any and all documentation available and search them for relevant info. After all, if it is allready written somewhere, why should someone have to rewrite it into a forum to answer your question?</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Choose a clear title</strong>\n    </line>\n    <line>Choosing a clear and describing title is important, it is the first information someone considering answering your question will read. Saying &quot;I need help&quot;, &quot;Newbie question&quot;, or &quot;Installation question&quot; doesn&apos;t help anyone who reads the title. Everyone needs help, and if you&apos;re posting in the installation forum, don&apos;t you think that people know it&apos;s about installation? </line>\n    <line>Also your title will let a reader decide if the question you are posting is something they can answer. If they from your title can see that the question is outside their knowledge, they can use their time to answer someone whom they might actually be able to help.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Describe your goal</strong>\n    </line>\n    <line>Sometimes a clear idea of what you&apos;re trying to achieve is relevant to the question asked. Use a few sentences describing what you&apos;re trying to do. Be brief and precise.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Describe your problem</strong>\n    </line>\n    <line>&quot;Installation don&apos;t work&quot; isn&apos;t very descriptive. More information is needed. How far have you got? What does work? What testing have you done? What system are you running on? You should take at least five minutes to describe your problem. If you get any error messages in your logs, always paste them into you posting. Look in your apache error log, in your php error log and any error messages encountered in your browser. </line>\n    <line>The extra minutes you use to get this information and describing your problem clearly is well worth the time, since it might help someone answer your question. In fact, the few extra minutes you use on your question is well spent after using several hours on your problem. Who knows, you might even see the solution why you take the time to rethink your problem. </line>\n    <line>Remember to include the name of the program, module or plug-in you have a problem with, also remember their version numbers.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Reread before you post</strong>\n    </line>\n    <line>Use a few minutes reading your posting. Try to see if you have left out important information, or if there are extra information you can supply.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Don&apos;t expect an answer right away</strong>\n    </line>\n    <line>The forums are supported by the community. People answer at their leisure and level of knowledge. You will also find answers from the crew and together with the community this will be a very valuable part of the documentation.</line>\n  </paragraph>\n  <paragraph>\n    <line>\n      <strong>Do not use improper language</strong>\n    </line>\n    <line>A post that contains improper language like cursing and swearing will be removed from the forums. It will not be answered in any way and will be removed without warning by the administrators of the forum.</line>\n  </paragraph>\n  <paragraph>Otherwise normal behavior is expected.</paragraph>\n</section>',1045487555,0,0,0,'','ezxmltext');
